import React, {useState} from 'react'

import {
    Button,
    Table,
    TableContainer,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Container,
    MenuItem,
    Menu,
    TablePagination

    
    
} from '@mui/material'
import MoreVertIcon from '@mui/icons-material/MoreVert'


const Import = (props) => {
    // fill out this component
    console.log(props)
// *pagination
const [page, setPage] = React.useState(0);
const [rowsPerPage, setRowsPerPage] = React.useState(10);
const [makes, setMakes] = React.useState([]);

// Avoid a layout jump when reaching the last page with empty rows.
const emptyRows =
page > 0 ? Math.max(0, (1 + page) * rowsPerPage - makes.length) : 0;

const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };







    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    }
    const handleClose = () => {
        setAnchorEl(null);
      };
    const [deleteMakes] = useState(null);

    const handleDeletes = (index) => {
        props.deleteMakes(deleteMakes, index)
        setAnchorEl(null);
    }

    return (
      
        <Container>
              <br />
              <br />
        <Button
            variant="contained"
            color="primary"
            onClick={props.fetchMakes}>Import</Button>
            
            <h2> Count: {props.makes.length}</h2>

            <TableContainer>
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Id</TableCell>
                    <TableCell>Make</TableCell>
                    <TableCell>Actions</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
            {(rowsPerPage > 0
              ? makes.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              : makes
            ).map(() => (
          
                    <TableRow key={index}>
                        <TableCell>{makes.MakeId}</TableCell>
                        <TableCell>{makes.MakeName}</TableCell>
                        <TableCell>
                            <MoreVertIcon onClick={handleClick} />
                         
                            <Menu   
                                    id="basic-menu"
                                    anchorEl={anchorEl}
                                    keepMounted
                                    open={Boolean(anchorEl)}
                                    onClose={handleClose}
                                 
                                    
                                >
                                    <MenuItem onClick={handleDeletes}>Delete</MenuItem>
                                    <MenuItem onClick={handleClose}>Close</MenuItem>
                                </Menu>
                                                        
                         </TableCell>   
                    </TableRow>
            ))}
            </TableBody>
        </Table>
        </TableContainer>
        <br />
        <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
      
</Container>
        
    )
}

export default Import
